
-- Full protection: anti-tamper + base64 encode + self-destruct GUI
local encoded = [[]]

-- Verify integrity
local expected_checksum = 12542486
local function getChecksum(str)
    local sum = 0
    for i = 1, #str do
        sum = sum + string.byte(str, i)
    end
    return sum
end

-- Decode and validate
local success, decoded = pcall(function()
    return game:GetService("HttpService"):Base64Decode(encoded)
end)

if not success or getChecksum(decoded) ~= expected_checksum then
    warn("Tampering detected. Destroying GUI...")
    local gui = game:GetService("CoreGui"):FindFirstChild("NaJaHub")
    if gui then
        gui:Destroy()
    end
    return
end

-- Load original script
loadstring(decoded)()
